(80, 3, 43, 'selUsrF', '회원상세', 4, 'R', 'RTN_SELECT_ONE', 0, 'select \n	USR_SEQ, USR_ID, USR_NM, \'--Hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_SEQ = #{G2-USR_SEQ}\n', NULL, '20180305223419', '20190207224307'),
(81, 3, 48, 'insMenuG', 'insMenuG', 4, 'C', 'RTN_INT', 0, 'insert into CMN_MNU (\n	PGMID, MNU_NM, URL, MNU_ORD, FOLDER_SEQ\n	,USE_YN, PGMTYPE, ADD_DT, ADD_ID\n) values (\n	#{PGMID}, #{MNU_NM}, #{URL}, if(#{MNU_ORD}=\'\',10,#{MNU_ORD}), #{FOLDER_SEQ}\n	,if(#{USE_YN}=\'\',\'Y\',#{USE_YN}), #{PGMTYPE}, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)\n', NULL, '20180306225540', '20180329191450'),
(82, 3, 48, 'delMenuG', 'delMenuG', 4, 'D', 'RTN_INT', 0, 'delete from CMN_MNU\nwhere MNU_SEQ = #{MNU_SEQ}', NULL, '20180307223011', '20180307223421'),
(83, 3, 42, 'updUsr', 'uprUsr', 4, 'U', 'RTN_INT', 0, 'update CMN_USR set\n	USR_PWD = #{G2-USR_PWD}\nwhere USR_SEQ = #{G2-USR_SEQ}', NULL, '20180308231922', '20180309101804'),
