(90, 3, 48, 'updMenuG', 'updMenuG', 4, 'U', 'RTN_INT', 0, 'update CMN_MNU set\n	PGMID = #{PGMID}, MNU_NM = #{MNU_NM}, MNU_ORD = if(#{MNU_ORD}=\'\',10,#{MNU_ORD}), FOLDER_SEQ = #{FOLDER_SEQ}, USE_YN = #{USE_YN}\n	,PGMTYPE = #{PGMTYPE}\n	,MOD_DT =  date_format(sysdate(),\'%Y%m%d%H%i%s\')\n	,MOD_ID = #{USER.SEQ}\nwhere MNU_SEQ = #{MNU_SEQ}\n', NULL, '20180321081554', '20180329191434'),
(91, 3, 56, 'selSizeG', 'SIZE', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n  0 as CHK, a.COLID,b.PGMSEQ,b.IOSEQ,a.DATASIZE AS DD_DATASIZE\n , b.DATASIZE AS IO_DATASIZE\n , b.ADDDT, b.MODDT\nFROM CG_DD a \n JOIN CG_PGMIO b on a.PJTSEQ = b.PJTSEQ and a.COLID = b.COLID\nwhere a.PJTSEQ = 3 anD a.DATASIZE != b.DATASIZE\nORDER BY COLID ASC', NULL, '20180325151322', '20180325165857'),
(92, 3, 56, 'selTypeG', 'TYPE', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n  0 as CHK, a.COLID,b.PGMSEQ,b.IOSEQ,a.DATATYPE AS DD_DATATYPE\n , b.DATATYPE AS IO_DATATYPE\n , b.ADDDT, b.MODDT\nFROM CG_DD a \n JOIN CG_PGMIO b on a.PJTSEQ = b.PJTSEQ and a.COLID = b.COLID\nwhere a.PJTSEQ = 3 anD a.DATATYPE != b.DATATYPE\nORDER BY COLID ASC', NULL, '20180325151322', '20180325165923'),
(93, 3, 56, 'updSizeG', 'SIZE', 3, 'U', 'RTN_INT', 0, 'update CG_PGMIO io JOIN CG_DD dd\n	on io.COLID = dd.COLID\n        and io.PJTSEQ = dd.PJTSEQ\nset\n        io.DATASIZE = dd.DATASIZE\n        ,io.MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere io.IOSEQ = #{IOSEQ}', NULL, '20180325152729', '20180325165734'),
(94, 3, 56, 'updTypeG', 'TYPE', 3, 'U', 'RTN_INT', 0, 'update CG_PGMIO io JOIN CG_DD dd\n	on io.COLID = dd.COLID\n        and io.PJTSEQ = dd.PJTSEQ\nset\n        io.DATATYPE = dd.DATATYPE\n        ,io.MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere io.IOSEQ = #{IOSEQ}', NULL, '20180325152946', '20180325165748'),
(95, 3, 56, 'selValidG', 'VALID', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n  0 as CHK, a.COLID,b.PGMSEQ,b.IOSEQ,a.VALIDSEQ AS DD_VALIDSEQ\n , b.VALIDSEQ AS IO_VALIDSEQ\n , b.ADDDT, b.MODDT\nFROM CG_DD a \n JOIN CG_PGMIO b on a.PJTSEQ = b.PJTSEQ and a.COLID = b.COLID\nwhere a.PJTSEQ = 3 anD a.VALIDSEQ != b.VALIDSEQ\nORDER BY COLID ASC', NULL, '20180325172446', '20180325172452'),
(96, 3, 56, 'updValidG', 'VALID', 3, 'U', 'RTN_INT', 0, 'update CG_PGMIO io JOIN CG_DD dd\n	on io.COLID = dd.COLID\n        and io.PJTSEQ = dd.PJTSEQ\nset\n        io.VALIDSEQ = dd.VALIDSEQ\n        ,io.MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere io.IOSEQ = #{IOSEQ}', NULL, '20180325172528', NULL),
(97, 3, 4, 'selMasG', 'MAS', 3, 'R', 'RTN_SELECT_LIST', 0, 'select \n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT,MODDT\nfrom \n	CG_CODE\norder by ORD asc', NULL, '20180325192036', '20180716172431'),
(98, 3, 4, 'selDtlG', 'DTL', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	CODED_SEQ,CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CG_CODED\nwhere PCD = #{G2-PCD}\norder by ORD ', 0, '20180325192242', '20190624233317'),
(99, 3, 4, 'insMasG', 'MAS', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODE (\n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT\n) values (\n	#{PCD},#{PNM},#{PCDDESC},if(#{ORD}=\'\',\'10\',#{ORD})\n	,#{UITOOL},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', NULL, '20180325193702', '20180716172431'),
