(257, 24, 75, 'sTeam', 'TEAM1', 5, 'R', 'RTN_SELECT_LIST', 0, 'select uuid() as UUID_SEQ, c.TEAM_NM\n, sum( case when priority = 1 then 1 else 0 end ) as PRIORITY_1\n, sum( case when priority = 2 then 1 else 0 end ) as PRIORITY_2\n, sum( case when priority = 3 then 1 else 0 end ) as PRIORITY_3\n, count(b.LOADD_SEQ) as vul_cnt  \nfrom \n	TEAMINFO c\n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a <> b and c <> d and e <= f and g >= h and i != j\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc', NULL, '20181114075303', '20190602203523'),
(258, 24, 75, 'sSys', 'SYS', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM,SYS_NM, SUBSYS_NM, count(b.LOADD_SEQ) as VUL_CNT\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM  = #{G3-TEAM_NM}\ngroup by TEAM_NM, SYS_NM, SUBSYS_NM\norder by count(b.LOADD_SEQ) desc', NULL, '20181114075303', NULL),
(259, 24, 75, 'sRule', 'RULESET', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE as RULESET, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM = #{G4-TEAM_NM} and \n 	case \n		when #{G4-SUBSYS_NM} = \'\' then \n 			a.SUBSYS_NM  = \'\' or a.SUBSYS_NM is null\n		else a.SUBSYS_NM = #{G4-SUBSYS_NM}\n	end \n	and a.SYS_NM = #{G4-SYS_NM} \ngroup by TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE\norder by count(b.LOADD_SEQ) desc', NULL, '20181114075303', NULL),
(260, 24, 75, 'sTeamChart', 'TEAM2', 5, 'R', 'RTN_SELECT_LIST', 0, 'select c.TEAM_NM, count(distinct b.type) as TYPE_CNT, ifnull(count(b.LOADD_SEQ),0) as VUL_CNT\nfrom \n	TEAMINFO c \n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere \ncase when #{G1-EX_TEAM_NM} <> \'\' then c.TEAM_NM <> #{G1-EX_TEAM_NM} \n	else\n		1=1\n	end\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc\n\n', NULL, '20181114075304', NULL),
(261, 3, 66, 'sPieD', 'Pie', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT substring(add_dt,1,8) as LOGIN_DT\n	, count(login_seq) as LOGIN_CNT \n	, count(login_seq)+10 as LOGIN_CNT2\nFROM CMN_LOG_LOGIN\nWHERE substring(add_dt,1,8) = #{G3-LOGIN_DT}\nGROUP BY substring(add_dt,1,8)\nORDER BY substring(add_dt,1,8)\n', NULL, '20190322215733', '20190325205454'),
(262, 3, 66, 'sPieSel', 'PIE', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT substring(add_dt,1,8) as LOGIN_DT\n	, count(login_seq) as LOGIN_CNT \n		, count(login_seq)+10 as LOGIN_CNT2\nFROM CMN_LOG_LOGIN\nGROUP BY substring(add_dt,1,8)\nORDER BY substring(add_dt,1,8)', NULL, '20190325205454', '20190325211443'),
